Group3886.children.append(x3d.Comment("""This Roll1 example shows Y-axis control of Joint nodes"""))
Group3886.children.append(x3d.Comment("""that through the skeleton hierarchy control"""))
Group3886.children.append(x3d.Comment("""Segment geometry and Site position."""))
Group3886.children.append(x3d.Comment("""So, the following interpolator:"""))
Group3886.children.append(x3d.Comment("""<OrientationInterpolator DEF='skullbase_RotationInterpolator' key='0 0.5 1' keyValue='0 0 1 0, 0 0 1 1, 0 0 1 0'/>"""))
Group3886.children.append(x3d.Comment("""will start at 0 move to +1 radian of z-axis"""))
Group3886.children.append(x3d.Comment("""rotation of the Joint, then return to 0."""))
Group3886.children.append(x3d.Comment("""0 0 1 0 is default value, meaning set to"""))
Group3886.children.append(x3d.Comment("""0 radians = zero degrees"""))
Group3886.children.append(x3d.Comment("""2pi radians = 360 degrees."""))
Group3886.children.append(x3d.Comment("""form: x y z scale"""))
Group3886.children.append(x3d.Comment("""pitch, yaw, roll right hand rule"""))
Group3886.children.append(x3d.Comment("""in radians 0 to <+-inf."""))
Group3886.children.append(x3d.Comment("""actual result = x y z per scale"""))
Group3886.children.append(x3d.Comment("""1 0.5 -0.3 0.5 = 0.5x 0.25y -0.05z"""))
Group3886.children.append(x3d.Comment("""1 radian = about 60 degrees"""))
Group3886.children.append(x3d.Comment("""360 degrees divided by 2 times pi"""))
Group3886.children.append(x3d.Comment("""Right hand rule for axes so a"""))
Group3886.children.append(x3d.Comment("""positive roll value applied to the"""))
Group3886.children.append(x3d.Comment("""skullbase Joint would rotate the"""))
Group3886.children.append(x3d.Comment("""the gaze of model ccw toward the"""))
Group3886.children.append(x3d.Comment("""model&apos;s +X direction, the model left"""))
Group3886.children.append(x3d.Comment("""toward the left shoulder."""))
